/* Loop Code: */
let candle=record.current
let volume=getElement('volumes',candle)

//POSITIVE VOLUME INDEX [PVI] CALCULATION
if (variable.previouspvi==undefined){
    variable.previouspvi=volume.buy
}
if (variable.previousvolume==undefined){
    variable.previousvolume=volume.buy
}
if (variable.previousclose==undefined){
    variable.previousclose=candle.close
}
//---- PVI formula
let pvi=(volume.buy>variable.previousvolume)?variable.previouspvi+((candle.close-variable.previousclose)/variable.previousclose)*variable.previouspvi:variable.previouspvi

//---- PVI EMA_M calculation
let pvim=calculateEMA(variable.M,pvi,variable.previouspvim)

//---- PVI EMA_M store into array
variable.pvim90.push(pvim)
if (variable.pvim90.length>90) {
    variable.pvim90.splice(0, 1)
}
//---- PVI max & min
let pvimax=Math.max(...variable.pvim90)
let pvimin=Math.min(...variable.pvim90)

//OSCP CALCULATION
let oscp
if(pvimax-pvimin!==0){
    oscp=(pvi-pvim)*100/(pvimax-pvimin)
}
else{
    oscp=0
} 

//NEGATIVE VOLUME INDEX [NVI] CALCULATION
if (variable.previousnvi==undefined){
    variable.previousnvi=volume.buy
}
//---- NVI formula
let nvi=(volume.buy<variable.previousvolume)?variable.previousnvi+((candle.close-variable.previousclose)/variable.previousclose)*variable.previousnvi:variable.previousnvi

//---- NVI EMA_M calculation
let nvim=calculateEMA(variable.M,nvi,variable.previousnvim)

//---- PVI EMA_M store into array
variable.nvim90.push(nvim)
if (variable.nvim90.length>90){
    variable.nvim90.splice(0, 1)
}
//---- PVI max & min
let nvimax=Math.max(...variable.nvim90)
let nvimin=Math.min(...variable.nvim90)

//BLUE CALCULATION
let tblue

if(nvimax-nvimin!==0){
    tblue=(nvi-nvim)*100/(nvimax-nvimin)
}
else{
    tblue=0
}
if(variable.nvim90.length<90){
    tblue=0
}

//MONEY FLOW INDEX [MFI] CALCULATION
let src=(candle.max+candle.min+candle.close)/3
if (variable.previoussrc==undefined){
    variable.previoussrc=(candle.max+candle.min+candle.close)/3
}
//----upper
variable.src14u.push(volume.buy*(src-variable.previoussrc)<=0?0:src)
if (variable.src14u.length>14){
    variable.src14u.splice(0,1)
}
let upper
if(variable.src14u.length>1){
    upper=variable.src14u.reduce((a,b)=>a+b,0)
}
else{
    upper=variable.src14u[0]
}

//----lower
variable.src14l.push(volume.buy*(src-variable.previoussrc)>=0?0:src)
if (variable.src14l.length>14){
    variable.src14l.splice(0,1)
}
let lower
if(variable.src14l.length>1){
    lower=variable.src14l.reduce((a,b)=>a+b,0)
}
else{
    lower=variable.src14l[0]
}

//----rsi
let mfi
if(lower==0)
    mfi=100
else if(upper==0)
    mfi=0
else
    mfi=100-(100/(1+upper/lower))
let xmf=mfi

//TPRICE CALCULATION
let tprice=(candle.open+candle.max+candle.min+candle.close)/4

//BASIS CALCULATION
variable.basis25.push(tprice)
if (variable.basis25.length>25) {
    variable.basis25.splice(0, 1)
}
let basis=calculateSMA(variable.basis25)

//DEV CALCULATION & BOUNDARIES
let dev=variable.MULT*calculateSTDev(variable.basis25)
let upperbound=basis+dev
let lowerbound=basis-dev
let ob1=(upperbound+lowerbound)/2
let ob2=(upperbound-lowerbound)
let bollosc
if (ob2==0){
    bollosc=0
}
else{
    bollosc=((tprice-ob1)/ob2)*100
}

//XRSI CALCULATION
if (variable.previoustprice==undefined){
    variable.previoustprice=tprice
}
let xrsi=calculateRSI(tprice,variable.previoustprice,14)

//STOC CALCULATION
let stoc=calculateSTOC(tprice,21,3)

//BROWN CALCULATION
let tbrown=(xrsi+xmf+bollosc+(stoc/3))/2
if(variable.nvim90.length<25){
    tbrown=0
}

//GREEN CALCULATION
let tgreen=tbrown+oscp
if(variable.nvim90.length<90){
    tgreen=0
}

//SIGNAL CALCULATION
let tsignal=calculateEMA(variable.M,tbrown,variable.previoustsignalm)
if(variable.nvim90.length<40){
    tsignal=0
}

//HISTOGRAM CALCULATION
let thistogram=tbrown-tsignal
if(variable.nvim90.length<40){
    thistogram=0
}

//Decimal reduction
if (tblue!==undefined){
    variable.value=tblue.toFixed(2)
} else {
    variable.value=0
}
variable.blue=variable.value
if (tbrown!==undefined){
    variable.value=tbrown.toFixed(2)
} else {
    variable.value=0
}
variable.brown=variable.value
if (tgreen!==undefined){
    variable.value=tgreen.toFixed(2)
} else {
    variable.value=0
}
variable.green=variable.value
if (tsignal!==undefined){
    variable.value=tsignal.toFixed(2)
} else {
    variable.value=0
}
variable.signal=variable.value
if (thistogram!==undefined){
    variable.value=thistogram.toFixed(2)
} else {
    variable.value=0
}
variable.histogram=variable.value

//---- "Previous" variables update for next loop
variable.previousvolume=volume.buy
variable.previousclose=candle.close
variable.previouspvi=pvi
variable.previouspvim=pvim
variable.previousnvi=nvi
variable.previousnvim=nvim
variable.previoussrc=src 
variable.previoustprice=tprice
variable.previoustsignalm=tsignal

//functions

function calculateEMA(periods,price,previousEMA){
    let k=2/(periods+1)
    return price*k+previousEMA*(1-k)
}

function calculateSMA(myarray){
    let sum=0
    for (let i=0;i<myarray.length;i++) {
        sum=sum+myarray[i]
    }
    let sma=sum/myarray.length
    return sma
}

function calculateSTDev(dataArr) {
    let result
    if(dataArr.length>1){
    let mean = dataArr.reduce((a,b)=>a+b,0)/dataArr.length
    result=Math.sqrt(dataArr.reduce((sq,n)=>sq+Math.pow(n-mean,2),0)/(dataArr.length-1))
        if ((result==undefined)||isNaN(result)) {
            result=0
        }
    }
    else{
        result=0
    }
        return result
}

function calculateRSI(price,previousprice,periods){
    if(price>previousprice){
        variable.tprice14u.push(price-previousprice)
    }
    else{
        variable.tprice14u.push(0)
    }
    if(price<previousprice){
        variable.tprice14d.push(previousprice-price)
    }
    else{
        variable.tprice14d.push(0)
    }
    if (variable.tprice14u.length>periods) {
        variable.tprice14u.splice(0, 1)
    }
    if (variable.tprice14d.length>periods) {
        variable.tprice14d.splice(0, 1)
    }
    let avgU = calculateAVG(variable.tprice14u)
    let avgD = calculateAVG(variable.tprice14d)
    let relativeStrength
    if (avgD>0) {
        relativeStrength=avgU/avgD
    } else {
        relativeStrength=0
    }
    return (100-100/(1+relativeStrength))
}

function calculateSTOC(src,length,smoothFastD){
    variable.stoc21ll.push(candle.min)
    if (variable.stoc21ll.length>length){
        variable.stoc21ll.splice(0, 1)
    }
    let lowest=Math.min(...variable.stoc21ll)

    variable.stoc21hh.push(candle.max)
    if (variable.stoc21hh.length>length){
        variable.stoc21hh.splice(0, 1)
    }
    let highest=Math.max(...variable.stoc21hh)
    let k=100*(src-lowest)/(highest-lowest)
    variable.k3.push(k)
    if (variable.k3.length>smoothFastD){
        variable.k3.splice(0, 1)
    }
    return calculateSMA(variable.k3)
}

function calculateAVG(myarray) {
    let sumU=0 
    for (let j=0;j<myarray.length;j++) { 
        sumU=sumU+myarray[j]
    }
    let averageU=sumU/myarray.length
    return averageU
}

