    variable.pattern.name="WHALE"
}
if(koncorde.histogram>0 && koncorde.green>koncorde.brown && koncorde.blue>0){
    variable.pattern.name="SPRING"
}
if(koncorde.histogram>0 && koncorde.green>koncorde.brown && koncorde.blue<0 && koncorde.brown>90 && koncorde.histogram<10){
